const Users = ({ users }) => {
  return (
    <>
      <h3>Users</h3>
      <ul className="list-group">
        {users.map(user => {
          return (
            <div className="userContainer">
              <div className="userImgContainer">
                <img style={{ borderRadius: "50%" }} src="https://api.adorable.io/avatars/120/123.png" />
              </div>
              <li key={user.id} style={{ paddingBottom: '10px' }} className="list-group-item list-group-item-action">

                <strong>{user.name}</strong>
                <p>Email: {user.email}</p>
                <a href={`//${user.website}`}>{user.website}</a>
              </li>
            </div>
          );
        })}
      </ul>
    </>
  );
}

export default Users;
